import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTwitter } from '@fortawesome/free-brands-svg-icons';


const Twitter = () =>{
return(
    <a href="twitter.com">
<FontAwesomeIcon icon={faTwitter} size="6x" />
</a>
    )
}

export default Twitter;
